import axios from 'axios'
import { Typography } from '@mui/material'




const TEST = () => {

const [data,setData] = useState([])

useEffect(() => {
  axios.get("http://localhost/REACTJS/cognate1%20api/ProductdataAPI.php")
  .then(res=>setData(res.data))
})



  return (
    <div>

        {data.map(name => 
        
          <img
          key={name.Product_ID}
          src={name.Product_image}
          alt='sauce'
          />
      
  
        
        
        
        )}



    </div>
  )
}

export default TEST
